        title: "VW",
        author: "SJP",
        cols: 2
      },
      {
        img: require("../images/touring2.JPG"),
        title: "VW",
        author: "SJP",
        cols: 1
      }
    ];

    const nature = [
      {
        img: require("../images/nature3.JPG"),
        title: "VW",
        author: "SJP",
        cols: 1
      },
      {
        img: require("../images/nature1.JPG"),
        title: "VW",
        author: "SJP",
        cols: 2
      },
      {
        img: require("../images/nature2.JPG"),
        title: "VW",
        author: "SJP",
        cols: 2
      }
    ];
    var height = 250;
    return (
      <div class="misc" id="misc">
        <div className="background2" />

        <Typography variant="h3" className="center1">
          <Slide left>PHOTOS</Slide>
          <Slide left>
            <div className="subhead" />
          </Slide>
        </Typography>
        <div className="">
          {/* <Fade delay="200">
            <Slide bottom> */}
          {/* <GridList cellHeight={height} className="overflow" cols={5}>
                {gcf.map(tile => (
                  <GridListTile key={tile.img} cols={tile.cols || 1}>
                    <div className="picture">
                      <div className="picture3">
                        <a className="none2" href={tile.img} target="_blank">
                          <div className="download">VIEW</div>
                        </a>
                      </div>

                      <img
                        src={tile.img}
                        alt={tile.title}
                        className="picture2"
                      />
                    </div>
                  </GridListTile>
                ))}
                {nature.map(tile => (
                  <GridListTile
                    key={tile.img}
                    cols={tile.cols || 1}
                    className="overflow"
                  >
                    <div className="picture overflow">
                      <div className="picture3 overflow">
                        <a
                          className="none2 overflow"
                          href={tile.img}
                          target="_blank"
                        >
                          <div className="download">VIEW</div>
                        </a>
                      </div>

                      <img
                        src={tile.img}
                        alt={tile.title}
                        className="picture2"
                      />
                    </div>
                  </GridListTile>
                ))}
                {touring.map(tile => (
                  <GridListTile key={tile.img} cols={tile.cols || 1}>
                    <div className="picture">
                      <div className="picture3">
                        <a className="none2" href={tile.img} target="_blank">
                          <div className="download">VIEW</div>
                        </a>
                      </div>

                      <img
                        src={tile.img}
                        alt={tile.title}
                        className="picture2"
                      />
                    </div>
                  </GridListTile>
                ))}
                {vw.map(tile => (
                  <GridListTile key={tile.img} cols={tile.cols || 1}>
                    <div className="picture">
                      <div className="picture3">
                        <a className="none2" href={tile.img} target="_blank">
                          <div className="download">VIEW</div>
                        </a>
                      </div>

                      <img
                        src={tile.img}
                        alt={tile.title}
                        className="picture2"
                      />
                    </div>
                  </GridListTile>
                ))}
              </GridList> */}

          {/* </Slide>
          </Fade> */}
          <Gallery photos={gcf} />
          <Gallery photos={gcf} />

        </div>

      </div>
    );
  }
}
